function Persona(props) {
    let nombre = props.name;
    let edad = props.age;
    return <p>{nombre}</p>;
    if (edad>17) {
        return <p>Invitar a tomar algo</p>
    }else{
        return <p>No tiene edad legal para tomar alcohol</p>
    };
  }
